import React, { useState } from 'react';

const Carousel = () => {
    const [num, setNum] = useState(5);

    const incNum = () => {
        setNum(num + 1)
    }

    return(
        <>
            <div className='main_div'>
                <div className='center_div'>
                    <div className='btn_div'>
                        <button onClick={incNum}>+</button>
                        <h2>{num}</h2>
                        <button>-</button>
                    </div>
                </div>
            </div>
        </>
    )
}

export default Carousel;
